  }
  input {
    flex: 1;
    margin-bottom: 15px;
    padding: 8px 20px;
    border-radius: 50px; 
    color: 	#FF69B4;
    font-size: 15px;
    width: 100%;
    border: 2px solid 	#FF69B4;
    &::placeholder {
      color: #C71585;
    }
  }
  button {
    color: #fff;
    font-size: 16px;
    background: #C71585;
    height: 40px;
    border: none;
    border-radius: 50px;
    width: 100%;
  }
  hr {
    margin: 20px 0;
    border: none;
    border-bottom: 1px solid 	#C71585;
    width: 100%;
  }
  a {
    font-size: 16;
    font-weight: bold;
    color: #C71585;
    text-decoration: none;
  }
